export const siteData = {
  "title": "shang-demo",
  "description": "Shang blog",
  "base": "/",
  "pages": [
    {
      "key": "v-13c0564c9f5a5",
      "path": "/",
      "lastUpdated": 1591841779000,
      "title": "Home",
      "frontmatter": {
        "home": true,
        "heroImage": "/vue-logo.png",
        "heroText": "blog-demo",
        "tagline": "博客示例",
        "actionText": "快速上手 →",
        "actionLink": "/",
        "features": [
          {
            "title": "简洁至上",
            "details": "以 Markdown 为中心的项目结构，以最少的配置帮助你专注于写作。"
          },
          {
            "title": "Vue驱动",
            "details": "享受 Vue + webpack 的开发体验，在 Markdown 中使用 Vue 组件，同时可以使用 Vue 来开发自定义主题。"
          },
          {
            "title": "高性能",
            "details": "VuePress 为每个页面预渲染生成静态的 HTML，同时在页面被加载的时候，将作为 SPA 运行。"
          }
        ]
      }
    },
    {
      "key": "v-6584c87420ec4",
      "path": "/blog/",
      "lastUpdated": 1591841779000,
      "title": "Firt blog"
    }
  ],
  "themeConfig": {
    "repoLabel": "My GitHub",
    "sidebarDepth": 4,
    "lastUpdated": "Last Updated",
    "searchMaxSuggestoins": 10,
    "serviceWorker": {
      "updatePopup": {
